from typing import Dict, Any

def merge_dicts(*dicts: Dict[Any, Any]) -> Dict[Any, Any]:
    """
    Merge multiple dictionaries into a single dictionary.

    Later dictionaries override earlier ones on key conflicts.
    None values are handled gracefully.

    Args:
        *dicts: Variable number of dictionaries to merge.

    Returns:
        A new merged dictionary.

    Raises:
        TypeError: If any argument is not a dictionary or None.
        ValueError: If no dictionaries are provided.

    Examples:
        >>> merge_dicts({"a": 1}, {"b": 2})
        {'a': 1, 'b': 2}
        >>> merge_dicts({"a": 1}, {"a": 2})
        {'a': 2}
        >>> merge_dicts({"a": 1}, None, {"b": 2})
        {'a': 1, 'b': 2}
    """
    if not dicts:
        raise ValueError("At least one dictionary must be provided")

    # Filter out None values
    valid_dicts = []
    for i, d in enumerate(dicts):
        if d is None:
            continue
        if not isinstance(d, dict):
            raise TypeError(
                f"Argument {i} must be a dictionary or None, "
                f"got {type(d).__name__}"
            )
        valid_dicts.append(d)

    if not valid_dicts:
        raise ValueError("At least one non-None dictionary must be provided")

    result: Dict[Any, Any] = {}

    # Merge all dictionaries
    for d in valid_dicts:
        result.update(d)

    return result


