if __name__ == "__main__":
    # Basic merge
    assert merge_dicts({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}

    # Override behavior
    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}

    # Multiple dictionaries
    assert merge_dicts({"a": 1}, {"b": 2}, {"c": 3}) == {"a": 1, "b": 2, "c": 3}

    # Later overrides earlier
    assert merge_dicts({"a": 1, "b": 2}, {"b": 3, "c": 4}) == {"a": 1, "b": 3, "c": 4}

    # None value handling
    assert merge_dicts({"a": 1}, None, {"b": 2}) == {"a": 1, "b": 2}
    assert merge_dicts(None, {"a": 1}) == {"a": 1}

    # Empty dictionaries
    assert merge_dicts({}, {"a": 1}) == {"a": 1}
    assert merge_dicts({"a": 1}, {}) == {"a": 1}
    assert merge_dicts({}, {}) == {}

    # Single dictionary
    assert merge_dicts({"a": 1}) == {"a": 1}

    # Complex values
    assert merge_dicts({"a": [1, 2]}, {"b": {"c": 3}}) == {"a": [1, 2], "b": {"c": 3}}

    # Error handling - no arguments
    try:
        merge_dicts()
        assert False, "Should raise ValueError"
    except ValueError as e:
        assert "At least one" in str(e)

    # Error handling - all None
    try:
        merge_dicts(None, None)
        assert False, "Should raise ValueError"
    except ValueError as e:
        assert "At least one non-None" in str(e)

    # Error handling - non-dict argument
    try:
        merge_dicts({"a": 1}, "not a dict")
        assert False, "Should raise TypeError"
    except TypeError as e:
        assert "must be a dictionary" in str(e)

    try:
        merge_dicts({"a": 1}, 123)
        assert False, "Should raise TypeError"
    except TypeError as e:
        assert "must be a dictionary" in str(e)

